INSERT INTO `gkqysg` VALUES (29, '浙江振冲岩土工程有限公司', '孙建辉', '15433095371', '林建国', '13505926589', '2007-07-04', '浙江杭州市余杭市市有害固体废物管理中心', '3', '0', '坍塌', '2007-07-14', '2007年7月4日下午4时30分左右,杭州市有害固体废物管理中心危险废物安全填埋场场地平整工地在打炮眼放炮时,由于违章作业产生阴山坎,发生塌方,造成正在下方作业的风钻工朱某等三人被埋.经过11小时抢救后,挖出确认三人已经死亡.');
INSERT INTO `gkqysg` VALUES (30, '浙江宝盛建设集团有限公司', '郑育芳', '18815992245', '范高山', '13898858245', '2012-12-24', '浙江杭州市肃山市', '3', '0', '起重伤害', '2012-12-30', '2012年12月24日上午人货梯在使用过程中发生故障,停在17号楼28层.下午,施工单位浙江宝盛建设集团有限公司通过杭州浙凯机械有限公司组织4名电梯维修人员进行维修.岳良国、岳良洪、罗云3人进入故障人货梯维修作业,下午14:40分左右人货梯从28楼突然坠落至地面,造成梯内3名维修人员一人当场死亡,其余两人送医院后不治身亡,事故共造成3人死亡.\r');
INSERT INTO `gkqysg` VALUES (31, '淳安县经纬物业管理拆修有限公司', '贝治发', '15656440666', '张长炳', '13761796105', '2009-06-23', '浙江杭州市淳安县', '3', '1', '坍塌', '2009-06-30', '淳安县经纬物业有限公司在位于淳安县千岛湖镇里杉柏区块综合改造项目房屋拆除作业时发生坍塌,当场死亡2人,另1人经抢救无效于当晚20时左右死亡.\r');
INSERT INTO `gkqysg` VALUES (32, '淳安五龙门水电开发有限公司', '郭伟华', '15894664734', '王凯悦', '13199760117', '2007-05-11', '浙江杭州市淳安县', '3', '0', '中毒和窒息', '2007-05-18', '2007年5月11日上午11时,淳安五龙门水电站引水隧道施工在进行爆破作业后,3名作业工人在未开通通风设备,未采取任何防范措施的情况下进入隧道清渣,导致炮烟中毒窒息死亡.');
INSERT INTO `gkqysg` VALUES (33, '宁波建工股份有限公司', '林千弟', '13542089198', '赵宝美', '13693408511', '2013-11-20', '浙江宁波市北仑', '5', '0', '中毒和窒息', '2013-11-30', '11月20日零时19分,由宁波建工股份有限公司承建的宁波工业供水有限公司工业供水管道青峙支线施工现场发生生产安全事故.事故造成5人死亡,1人受伤.事故直接原因已经查明.\r经宁波市政府事故调查组调查认定,宁波工业供水青峙支线管道项目的事故直接原因是：顶管施工单位在顶管施工过程中,将埋设在青峙1号路西侧非机动车道地下的林德(宁波)气体公司的氮气管道顶裂,造成氮气外泄,导致正在作业的施工人员5人窒息死亡,1人受伤.详细情况正在进一步调查之中.\r');
INSERT INTO `gkqysg` VALUES (34, '宁波瑞生再生资源有限公司', '娄锋', '13204793002', '郑小杰', '13559139057', '2016-06-29', '浙江宁波市镇海区', '3', '0', '其他爆炸', '2016-06-29', '2016年6月29日14时40分左右,位于镇海区后海塘定海路(再生资源加工园区内)的宁波瑞生再生资源有限公司内发生一起爆炸事故,造成3人死亡,2人受伤.');
INSERT INTO `gkqysg` VALUES (35, '浙江神洲船业有限公司', '杨家亮', '13978031758', '汪增成', '13546495945', '2008-11-25', '浙江宁波市象山县', '4', '0', '起重伤害', '2008-12-05', '11月25日12时40分左右,浙江神洲船业有限公司由于塔吊倒塌,致使现场施工的4名职工死亡,另1名职工受伤.\r');
INSERT INTO `gkqysg` VALUES (36, '宁波中瑞建设有限公司', '肖祥', '18113992766', '鲍伟红', '13281187900', '2015-10-02', '浙江宁波市慈溪', '4', '1', '中毒和窒息', '2015-10-12', '2015年10月2日下午15时许,位于慈溪市崇寿镇健民村的慈溪市排水有限公司西三泵站内,由宁波中瑞建设有限公司派遣的5名施工人员在实施污水汇集池抢修作业中发生疑似硫化氢中毒、淹溺而亡的事故.经核实,5名施工人员的身份信息如下：陈建权,男,身份证号：330222196509160676,坎墩直塘人,带班组长项目经理,死亡；孙建立,男,身份证号：330222196307120617,坎墩直塘人,死亡；孙建波,男,身份证号：330222196507040611,坎墩直塘人,死亡；徐小平,男,身份证号：330222197208275810,横河东上河村,死亡；陈建明,男,身份证号：330222196807120613,坎墩直塘人,正在抢救中.\r');
INSERT INTO `gkqysg` VALUES (37, '嘉兴市向阳化工厂', '郝小红', '13820501295', '周玉梅', '13183389378', '2012-01-04', '浙江嘉兴市南湖区', '3', '0', '其他爆炸', '2012-01-14', '2012年1月4日晚上21时55分许,位于南湖区大桥镇的嘉兴市向阳化工厂,N一异丙基羟胺车间发生爆炸,并引发火灾,该起事故造成3人死亡,4人受伤.死者1：蔡忠、(男、53岁、大桥镇八里花苑天北路17号人)；死者2：葛祥林、(男、46岁、大桥镇花园村曹家房7号人)；死者3：张月平、(男、52岁、大桥镇焦山门村打浜人).\r');
INSERT INTO `gkqysg` VALUES (38, '浙江菱化实业股份有限公司', '陈备战', '13599266421', '郑洪昌', '13230731751', '2007-11-28', '浙江湖州市德清县', '3', '0', '容器爆炸', '2007-12-05', '该公司亚磷酸二甲脂车间的二级脱酸甩釜发生燃爆,致在场的3名操作工重伤,经抢救无效死亡.');
INSERT INTO `gkqysg` VALUES (39, '绍兴市华元化工有限公司', '仲逸群', '13742541211', '王培怀', '13179176646', '2013-09-14', '浙江绍兴市上虞县', '3', '0', '容器爆炸', '2013-09-24', '在处理堵塞液萘罐结晶管道时,用电焊加热引发罐体爆炸.\r');
INSERT INTO `gkqysg` VALUES (40, '浙江恒隆芳纶科技有限公司', '潘军强', '13768505010', '张春芳', '13163722537', '2013-12-25', '浙江绍兴市绍兴县', '5', '0', '高处坠落', '2013-12-31', '2013年12月25日8点30分左右,7名圆机设备搬运人员在向吊机的吊篮推送圆机时,吊篮突然发生倾斜,造成6人跟圆机从高处坠落.');
INSERT INTO `gkqysg` VALUES (41, '浙江水泥有限公司', '吕光旺', '13880273438', '何凤娟', '13656228865', '2010-12-30', '浙江绍兴市绍兴县', '3', '0', '中毒和窒息', '2011-01-10', '在对3号库进行清库过程中,清库人员陈贤国从3米高的入孔门进入3号水泥进行清理,不辛滑入库中,被困其中,两位施工人员前去施救时,也不辛被困死亡.\r');
INSERT INTO `gkqysg` VALUES (42, '浙江八达建设集团有限公司', '王梦娈', '13357761797', '黄忠', '13721267894', '2012-06-16', '浙江湖州市吴兴区', '3', '0', '高处坠落', '2012-06-21', '2012年6月16日10点40分许,由浙江八达建设集团有限公司承建的湖州市爱山街道东吴国际广场在建工地发生一起三人死亡事故.据初步调查,事故是在十二楼电梯井道内施工过程中发生高处坠落,造成两人当场死亡,一人经医院抢救无效于13时50分许死亡.死者分别为：殷自国,男,48岁,四川三台人；肖龙好,男,55岁,四川三台人；马鸿,男,26岁,贵州普定人.\r');
INSERT INTO `gkqysg` VALUES (43, '浙江洁达环保集团有限公司', '倪东尔', '13542112357', '毛如东', '13535399079', '2014-11-13', '浙江绍兴市诸暨市', '3', '0', '其他爆炸', '2014-11-19', '2014年11月13日上午9时35左右,在浙江洁达集团有限公司铆焊车间内操作人员在打磨过程中,因胶管泄漏,丙烷沉积在钢板下相对有限空间内,遇打磨溅出的火星接触引起爆炸导致操作面强烈反弹,3名员工送人民医院抢救,其中邵志德、石廷彬于2014年11月13日抢救无效死亡,徐火峰于2014年11月17日经抢救无效死亡.\r');
INSERT INTO `gkqysg` VALUES (44, '浙江正方交通建设有限公司', '王国军', '15860025464', '王小宽', '13964143704', '2010-07-14', '浙江宁波市镇海区', '4', '0', '高处坠落', '2010-07-24', '7月14日6时左右,由浙江正方交通建设有限公司总承包的宁波绕城高速东段十(A)标段,5名工人搬运一台500公斤重的灰(浆)泵机从高架桥左幅,经临时人行通道,移动到右幅过程中,4人连同灰(浆)泵机从约15米高处坠落,送医院经抢救无效死亡.\r');
INSERT INTO `gkqysg` VALUES (45, '浙江恒越建设工程有限公司', '徐志芳', '13499896430', '邓梦婕', '13718404464', '2014-08-04', '浙江丽水市莲都区联城街道坑口村丽水500KV万象—瓯海线路送出工程', '3', '0', '中毒和窒息', '2014-08-14', '2014年8月4日18时30分许,由浙江省火电建设公司承建、浙江恒越建设工程有限公司施工的,莲都区联城街道坑口村“丽水500KV万象—瓯海线路送出工程”,在进行1号铁塔A腿基座基坑抽水作业时,1施工人员因一氧化碳中毒晕倒坑底,后由于施救不当,相继造成数名施救人员陆续中毒,3人死亡.\r');
INSERT INTO `gkqysg` VALUES (46, '浙江开盛生态农业发展有限公司', '徐爱芳', '13729630804', '周维高', '13333618428', '2015-11-06', '浙江衢州市江山市', '3', '0', '中毒和窒息', '2015-11-10', '11月6日16时左右,浙江开盛生态农业发展有限公司3名员工在进行巡检时,不慎滑入粪池,后经医院抢救无效死亡.');
INSERT INTO `gkqysg` VALUES (47, '玉环县建筑安装工程有限公司', '卓金福', '13833794350', '谭骏', '13525404863', '2009-06-12', '浙江台州市玉环县', '3', '0', '中毒和窒息', '2009-06-21', '2009年6月12日上午8:00时左右,位于玉环县坎门办事处里澳社区的台州丰润生物化学有限公司新建厂房建筑工地施工现场工人向立轩、苏长胜、江华等五人在工地人工挖孔桩旁作业.其中一个工人下到桩孔底部作业,因桩孔底部硫化氢含量过高致使中毒晕倒,后两人在无佩戴任何防护用品的情况下下到桩底救援,均先后晕倒.之后,剩下的两个地面人员系了麻绳下到桩孔底部救援,也先后晕倒.后坎门派出所民警接周边群众报警赶到现场,和现场的其他工人一起将该五名工人先后救起,其中两人病情稳定.向立轩、苏长胜、江华三人分别被送到坎门医院及玉环县人民医院,经抢救无效死亡.');
INSERT INTO `gkqysg` VALUES (48, '中天路桥有限公司', '吴孝斌', '15362008538', '王红', '13684894219', '2011-04-29', '浙江台州市温岭市地面', '3', '0', '起重伤害', '2011-05-09', '2011年4月25日下午4:30分,由中天路桥有限公司承建的75省道南延金清港大桥工程,在水上施工作业,50吨吊机在施工便桥平台作业时,不慎向西倾斜掉入水中,致使正在施工的5名民工落水,其中2人被救,施工组展开救援,到17:30分,1人被送往医院抢救无效死亡,2人失踪；到22:20分,打捞上1名尸体,到26日8时又打捞上一名尸体,本次事故造成3人死亡.\r');
INSERT INTO `gkqysg` VALUES (49, '浙江宏威车业有限公司', '周先桂', '15836295830', '彭永平', '13400231262', '2011-04-01', '浙江丽水市缙云县东渡镇浙江宏威车业有限公司一车间', '6', '0', '其他爆炸', '2011-04-11', '2011年4月1日20时31分左右,该企业铝制品配件打磨车间电器线路短路产生电火花引发电路起火,当班员工开展灭火自救工作,先用灭火器和水进行灭火,但灭火效果不明显,当班员工即用扫把、铁锹等进行拍打,扬起大量粉尘,引发第一次爆炸,在爆炸后员工开始撤离现场,此时发生了第二次大爆炸,直接导致3人当场死亡,3人受伤经医院抢救无效死亡.');
